import React, { Fragment } from "react";
import Home from "./pages/Home";
import { AfterHeader, BeforeHeader } from "./Header";
import {
    BrowserRouter as Router,
    Switch,
    Route
  } from "react-router-dom";
export default class layout{
    render(){  return (
    <Fragment>
      <AfterHeader></AfterHeader>
      {/* <Home/> */}
      <Router>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </Fragment>
  );
}
}
